@import '~style/helpers';

@keyframes onEnter {
  from {
    opacity: 0;
    transform: translateY(50px);
  }

  to {
    opacity: 1;
    transform: translateY(0);
  }
}

.banner {
  position: relative;
  color: $white;
  line-height: 1;
  z-index: 1;

