@import 'variables';
@import 'mixins';

.container {
  margin: 0 auto;
  padding: 0 25px;

  @media (min-width: $breakpoint-medium) {
    padding: 0 50px;
  }
}

.page {
  position: relative;
}
","
@import '~style/helpers';

$grid-item-distance: 20px;

.grid-item {
  display: flex;
  flex: 1 0 100%;
  width: 100%;
  max-width: 100%;
  margin: 0 0 3em;
  perspective: 100vw;

  @media (min-width: $breakpoint-medium) {
    margin-bottom: 4em;
    flex: 1 0 calc(50% - #{$grid-item-distance});
    width: calc(50% - #{$grid-item-distance});
    max-width: calc(50% - #{$grid-item-distance});
  }

  &.inview {
    h4 {
      will-change: transform, opacity;
    }

    .grid-item-wrapper {
      will-change: transform;
    }
  }

  &:hover {
    h4 {
      transform: translateZ(15px);
      opacity: 0.75;
    }
  }

  &:last-child {
    margin-bottom: 0;
  }

  @media (min-width: $breakpoint-medium) {
    &:nth-last-child(-n+2) {
      margin-bottom: 0;
    }
  }

  &:nth-child(odd) {
    h4 {
      @media (min-width: $breakpoint-medium) {
        left: -40px;
      }

      @media (min-width: $breakpoint-large) {
        left: -30px;
      }
    }
  }

  &:nth-child(even) {

    h4 {
      @media (min-width: $breakpoint-medium) {
        margin-top: -48px;
        padding-right: 1em;
        left: 15px;
      }

      @media (min-width: $breakpoint-large) {
        margin-top: -42px;
      }
    }
  }

  &:nth-child(3n+1) {
    &:hover {
      .grid-item-wrapper {
        transform: rotateY(-8deg) rotateX(3deg);
      }
    }
  }

  &:nth-child(3n+2) {
    &:hover {
      .grid-item-wrapper {
        transform: rotateY(8deg) rotateX(3deg);
      }
    }
  }

  &:nth-child(3n) {
    &:hover {
      .grid-item-wrapper {
        transform: rotateY(-3deg) rotateX(8deg);
      }
    }
  }

  a {
    padding: 1em;
    color: inherit;
    position: relative;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    height: 100%;
    background-color: rgba(255, 255, 255, 0.3);
  }

  h4 {
    margin: 0 0 0.5em;
    background: linear-gradient(180deg, #2443fb 0%, #39a9da 100%);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    font-size: 32px;
    line-height: 1;
    text-transform: uppercase;
    font-family: $header-font-family;
    position: relative;
    transition: transform 0.5s, opacity 0.5s;

    @media (min-width: $breakpoint-medium) {
      font-size: 54px;
      margin-left: -1rem;
    }

    @media (min-width: $breakpoint-large) {
      font-size: 48px;
    }
  }

  p {
    text-align: right;
    margin: 1em 0;

    &:last-child {
      margin-bottom: 0;
    }
  }

  .read-more {
    margin-top: 2em;
  }

  &-wrapper {
    width: 100%;
    max-width: 100%;
    border: ($grid-item-distance / 2) solid #fff;
    transform-style: preserve-3d;
    transition: transform 0.5s;
  }

  &-content {
    position: relative;
  }

  .info {
    display: flex;
    align-items: center;
    justify-content: flex-end;

    > * {
      + * {
        margin-left: 10px;
      }
    }
  }

  [data-likes] {
    &:after {
      content: attr(data-likes);
      font-family: $body-font-family;
    }
  }

  [data-likes='0'] {
    display: none;
  }

  .language {
    display: inline-block;
    width: 20px;
    height: 20px;
    background-position: center;
    background-repeat: no-repeat;
    background-size: contain;
  }

  .javascript {
    background-image: url('/assets/images/repo-js.svg');
  }

  .css {
    background-image: url('/assets/images/repo-js.svg');
  }

  .php {
    background-image: url('/assets/images/repo-js.svg');
  }
}

.read-more {
  font-size: 80%;
  text-transform: uppercase;
  font-weight: 700;
  // background: #2443fb;
  background: linear-gradient(180deg, #2443fb 0%, #39a9da 100%);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
}
