    display: inline-block;
    height: $header-height;
    line-height: $header-height;
    padding: 0 15px;
    min-width: 50px;
    text-align: center;
    background: rgba(255, 255, 255, 0);
    position: relative;
    color: $background-color;

    @media (max-width: $breakpoint-small - 1px) {
      color: $black;
      padding: 0;
      border-bottom: 1px solid fade-out($black, 0.85);
    }

    @media (min-width: $breakpoint-small) {
      &:before {
        content: '';
        position: absolute;
        top: 48px;
        width: 0;
        height: 3px;
        background: $pink;
        transform: translate(-50%, 0);
        left: 50%;
        transition: 0.35s width 0.05s;
        will-change: width;
      }

      &:hover,
      &:active {
        &:before {
          width: calc(100% - 10px);
        }
      }
    }
  }

  .active {
    &:before {
      width: calc(100% - 10px);
    }
  }
}
