// Document
// ========================================================================== */

html {
  font-family: sans-serif;
  line-height: 1.15;
  text-size-adjust: 100%;
}

// Sections
// ========================================================================== */

body {
  margin: 0;
}

article,
aside,
footer,
header,
nav,
section {
  display: block;
}

h1 {
  font-size: 2em;
  margin: 0.67em 0;
}

// Grouping content
// ========================================================================== */

figcaption,
figure,
main {
  display: block;
}

figure {
  margin: 1em 40px;
}

hr {
  box-sizing: content-box;
  height: 0;
  overflow: visible;
}

pre {
  font-family: monospace, monospace;
  font-size: 1em;
}

// Text-level semantics
// ========================================================================== */

a {
  background-color: transparent;
  text-decoration-skip: objects;
}

:active,
:hover {
  outline-width: 0;
}

abbr {
  &[title] {
    border-bottom: 0;
    text-decoration: underline dotted;
  }
}

b,
strong {
  font-weight: inherit;
}

strong {
  font-weight: bolder;
}

code,
kbd,
samp {
  font-family: monospace, monospace;
  font-size: 1em;
}

dfn {
  font-style: italic;
}

mark {
  background-color: #ff0;
  color: #000;
}

small {
  font-size: 80%;
}

sub,
sup {
  font-size: 75%;
  line-height: 0;
  position: relative;
  vertical-align: baseline;
}

sub {
  bottom: -0.25em;
}

sup {
  top: -0.5em;
}

// Embedded content
// ========================================================================== */

audio,
video {
  display: inline-block;
}

audio {
  &:not([controls]) {
    display: none;
    height: 0;
  }
}

img {
  border-style: 0;
}

svg {
  &:not(:root) {
    overflow: hidden;
  }
}

// Forms
// ========================================================================== */

button,
input,
optgroup,
select,
textarea {
  font-family: sans-serif;
  font-size: 100%;
  line-height: 1.15;
  margin: 0;
}

button,
input {
  overflow: visible;
}

button,
select {
  text-transform: 0;
}

button,
[type='button'],
[type='reset'],
[type='submit'] {
  appearance: button;

  &:focus-inner {
    border-style: 0;
    padding: 0;
  }

  &:focusring {
    outline: 1px dotted ButtonText;
  }
}

fieldset {
  border: 1px solid #c0c0c0;
  margin: 0 2px;
  padding: 0.35em 0.625em 0.75em;
}

legend {
  box-sizing: border-box;
  color: inherit;
  display: table;
  max-width: 100%;
  padding: 0;
  white-space: normal;
}

progress {
  display: inline-block;
  vertical-align: baseline;
}

textarea {
  overflow: auto;
}

[type='checkbox'],
[type='radio'] {
  box-sizing: border-box;
  padding: 0;
}

[type='number'] {
  &:inner-spin-button,
  &:outer-spin-button {
    height: auto;
  }
}

[type='search'] {
  appearance: textfield;
  outline-offset: -2px;

  &:search-cancel-button,
  &:search-decoration {
    appearance: 0;
  }
}

::file-upload-button {
  appearance: button;
  font: inherit;
}

// Interactive
// ========================================================================== */

details,
menu {
  display: block;
}

summary {
